        <div>


           <pre>
               {JSON.stringify(data, null, 4)}
           </pre>
        </div>
    )

}

MainPage.getInitialProps = async () => {
    await fetch('https://jsonplaceholder.typicode.com/posts')
        .then(response => response.json())
        .then(json => {
            return {data :json }
        })

}

